import React, { Component } from 'react';
import './App.css';
import ProductCategoryRow from './ProductsWindow.js';
import ProductRow from './ProductRow';

export default class ProductsWindow extends React.Component{

      render(){


            const rows = [];
            let lastCategory = null;

            this.props.products.forEach((product) => {
                  if (product.category !== lastCategory) {
                  rows.push(
                  <ProductCategoryRow
                        category={product.category}
                        key={product.category} />
                  );
                  }
                  rows.push(
                  <ProductRow
                  product={product}
                  key={product.name} />
                  );
                  lastCategory = product.category;
            });

            return(
                  <table>
                        <thead>

                        </thead>
                        <tbody>

                        </tbody>
                  </table>
            )
      }
}
